import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { Router } from "react-router-dom";
import { store } from './store';
import { Provider } from "react-redux";

ReactDOM.render(
    <Router>
      <App  store={store}></App>
    </Router>,
  document.getElementById("root")
);
